import Link from "next/link";
import React, { Component } from "react";
import Form from "../components/Form";

class Index extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <Form />
      </div>
    );
  }
}

export default Index;
